import sys
import cv2
import numpy as np
import io
from PyQt5.QtWidgets import QApplication, QWidget, QLabel, QVBoxLayout
from PyQt5.QtGui import QPixmap, QImage
from PyQt5.QtCore import Qt


class ImageDisplayWidget(QWidget):
    def __init__(self, image):
        super().__init__()
        self.setWindowTitle("OpenCV 图像显示")
        self.resize(800, 600)

        # 创建 QLabel 用于显示图像
        self.label = QLabel(self)
        self.label.setAlignment(Qt.AlignCenter)

        # 创建布局并添加 QLabel
        layout = QVBoxLayout(self)
        layout.addWidget(self.label)

        # 显示图像
        self.display_image(image)

    def display_image(self, image):
        # 将 OpenCV 图像转换为 QImage
        height, width, channel = image.shape
        bytes_per_line = 3 * width
        q_image = QImage(image.data, width, height, bytes_per_line, QImage.Format_RGB888).rgbSwapped()

        # 将 QImage 转换为 QPixmap 并显示
        pixmap = QPixmap.fromImage(q_image)
        self.label.setPixmap(pixmap)


if __name__ == "__main__":
    # 示例：加载图像数据
    values = videoData # 替换为你的实际数据
    values = values.strip('[]"')
    values = list(map(int, values.split(", ")))

    # 将字节列表转换为字节数据
    dataBytes = np.array(values, dtype=np.uint8).tobytes()

    # 使用 io.BytesIO 将字节数据转换为文件类对象
    imageData = io.BytesIO(dataBytes).getvalue()

    # 使用 cv2 读取图像数据
    image = cv2.imdecode(np.frombuffer(imageData, np.uint8), cv2.IMREAD_UNCHANGED)

    # 创建 PyQt 应用
    app = QApplication(sys.argv)

    # 创建窗口并显示图像
    window = ImageDisplayWidget(image)
    window.show()

    # 运行 PyQt 应用
    sys.exit(app.exec_())